import { useCallback } from "react";
import PropTypes from "prop-types";

const ProductTable = ({ className = "" }) => {
  const onTabContainerClick = useCallback(() => {
    window.open(
      "https://www.brilliantearth.com/diamond/round/#diamonds_panel_conflict"
