    window.open(
      "https://www.brilliantearth.com/loose-diamonds/view_detail/29365363/"
    );
  }, []);

  return (
    <section
      className={`self-stretch flex flex-row items-start justify-center py-0 px-5 box-border max-w-full text-center text-xs-4 text-wwwbrilliantearthcom-mine-shaft font-wwwbrilliantearthcom-inter-regular-1106 ${className}`}
    >
      <div className="flex flex-row items-start justify-start pt-5 px-[15px] pb-0 box-border max-w-[1290px] max-h-[999999px] z-[1] mq1525:max-w-full">
        <div className="w-[1260px] flex flex-col items-start justify-start max-h-[999999px] max-w-full">
